import { UserContext } from '../../App';

const CompontentC = () => {
    return (
        <div>
            <UserContext.Consumer>
                {
                    (user) => {
                        return <h1>my name is {user} from component C</h1>
                    }
                }
            </UserContext.Consumer>
        </div>
    )
}

